import { Mood } from './mood';

export const MOODS: Mood[] = [
  { id: 1, name: 'Happy' },
  { id: 2, name: 'Sad' },
  { id: 3, name: 'Bored' },
  { id: 4, name: 'Tired' },
  { id: 5, name: 'Excited' }, 
  { id: 6, name: 'Stressed' }, 
];
